      SELECT DISTINCT - COUNT ( * ) * - + COUNT ( + col0 ) + COUNT ( * ) + - - COUNT ( * ) AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q12850.out
    data: |
      15
